import React from "react";
import Tilt from 'react-tilt';
import './MyPhoto.css';

const MyPhoto = ({logo, width, onclick, text, bright}) => {
	const tiltstyle = {width}
	const imgStyle = {filter: brightness(bright)}
	return(
		<div className="MyPhoto" onClick={onclick}>
		<Tilt className="Tilt MyPhoto-tilt" style={tiltstyle}  options={{ max : 55 }} >
			<div className="Tilt-inner">
				<img src={logo} style={imgStyle} className="MyPhoto-tilt__img" alt="hemant garg"/> 
				<div className="MyPhoto-tilt-text">{text}</div>
			</div>
		</Tilt>
		</div>
	)
};

export default MyPhoto;
